// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import {IERC20} from "./IERC20.sol";
import {Pool} from "./pool.sol";

contract Router {
    address public admin;

    constructor() {
        admin = msg.sender;
    }

    struct SwapRoute {
        address poolAddress;     // Address of the liquidity pool
        address inputToken;      // Token being swapped in
        address outputToken;     // Token being received
        uint256 minAmountOut;    // Minimum acceptable output amount
    }

    // Multi-hop swap function
    function multiHopSwap(
        SwapRoute[] memory routes,    // Array of swap routes
        uint256 inputAmount,          // Amount of the first input token
        address recipient             // Address to receive final output token
    ) external returns (uint256 finalOutputAmount) {
        require(routes.length > 0, "No swap routes provided");
        require(inputAmount > 0, "Input amount must be greater than 0");
        require(recipient != address(0), "Invalid recipient");

        uint256 currentAmount = inputAmount;

        // Perform swaps for each route in the array
        for (uint256 i = 0; i < routes.length; i++) {
            SwapRoute memory route = routes[i];
            Pool pool = Pool(route.poolAddress);

            // Transfer the input token to this contract (user must approve this)
            IERC20(route.inputToken).transferFrom(msg.sender, address(this), currentAmount);

            // Approve the pool to use the input token
            IERC20(route.inputToken).approve(route.poolAddress, currentAmount);

            // Execute the swap in the pool contract
            currentAmount = pool.swap(route.inputToken, currentAmount, address(this), route.minAmountOut);

            // Ensure the swap was successful and meets the minAmountOut condition
            require(currentAmount >= route.minAmountOut, "Insufficient output amount");

            // After the last swap, transfer the final token to the recipient
            if (i == routes.length - 1) {
                IERC20(route.outputToken).transfer(recipient, currentAmount);
                finalOutputAmount = currentAmount;
            }
        }

        return finalOutputAmount;
    }

    // Direct swap function for a single pool (for comparison or simple use cases)
    function swapDirect(
        address poolAddress,    // Address of the pool contract
        address inputToken,     // The token being sent by the user
        uint256 inputAmount,    // Amount of input token being swapped
        address outputToken,    // The token the user wants to receive
        address recipient,      // The recipient of the output token
        uint256 minAmount       // Minimum acceptable output amount
    ) external returns (uint256 outputAmount) {
        Pool pool = Pool(poolAddress);

        // Transfer the input token to the router
        IERC20(inputToken).transferFrom(msg.sender, address(this), inputAmount);
        IERC20(inputToken).approve(poolAddress, inputAmount);

        // Call the swap function in the Pool contract
        outputAmount = pool.swap(inputToken, inputAmount, recipient, minAmount);
    }
}

